script: |
  super -f text -I q11668.spq | sort > q11668.out

inputs:
  - name: q11668.spq
    data: |
      SELECT 62 - col0 * 76 AS col2 FROM tab2 (FORMAT parquet) WHERE col1 NOT IN ( + + CAST ( NULL AS REAL ) * + CAST ( col0 AS INTEGER ) * + col0 / - + col2 + - 69 ) AND + col1 IS NULL;
  - name: tab2

outputs:
  - name: q11668.out
    data: |
